import React from 'react';
import TodoListItem from './todo-list-item';

const TodoList = ({todos}) => {

    return (
        <ul>

            <li><TodoListItem 
            label={todos[0].label}
            important={todos[0].important}
            /></li>
            <li><TodoListItem label="Build React App" important ="True"/></li>
        </ul>
    );
};

export default TodoList;
